import React from "react";

function List(groceries) {
  return (
    <div className="card">
                <ul className="list-group">
        <li>
          <strong>Id:</strong> {groceries.id}
        </li>
        <li>
          <strong>Name:</strong> {groceries.name}
        </li>
        <li>
          <strong>Purchased:</strong> {groceries.purhcased}
        </li>
      </ul>
    </div>
  );
}

function GroceryList (){
  List.map (List);
}

export default GroceryList;
